import { blue } from "@mui/material/colors";
import { Box, fontSize } from "@mui/system";
import { useState, useEffect } from "react";
import Navbar from "../templates/Navbar";
import React, { Component } from 'react';
import Buyer_Navbar from "../templates/Buyer_Navbar";
import axios from "axios";
import Wallet from "./Wallet";
import { useNavigate, useLocation } from "react-router";
import Paper from "@mui/material/Paper";
import Grid from "@mui/material/Grid";
import TableCell from "@mui/material/TableCell";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import Divider from "@mui/material/Divider";
import Autocomplete from "@mui/material/Autocomplete";
import IconButton from "@mui/material/IconButton";
import InputAdornment from "@mui/material/InputAdornment";

import SearchIcon from "@mui/icons-material/Search";


import { BrowserRouter as Router, Route, Link } from "react-router-dom";



const Myorders_buyer = (props) => {
    const navigate = useNavigate();

    // USERS LIST
    const [users, setUsers] = useState([]);
    const [sortedUsers, setSortedUsers] = useState([]);
    const [sortName, setSortName] = useState(true);
    const [searchText, setSearchText] = useState("");
    const [searchInput, setinput] = useState("");



    useEffect(() => {
      axios
        .get("http://localhost:4000/user/myorders")
        .then((response) => {
          setUsers(response.data);
          setSortedUsers(response.data);
          setSearchText("");
        })
        .catch((error) => {
          console.log(error);
        });
    }, []);



    return (
        <div>
            <div> <Buyer_Navbar></Buyer_Navbar></div>
            {/* <div> <Wallet /> </div> */}
            <h3  className="center"> My Orders</h3>
            <Box>
        <div>
          <div style={{ backgroundColor: "#FAE03B", padding: 30, textAlign: "center", marginTop: 100, fontSize: 30 }}>

            {/* <h1><center>email: {email}</center></h1>
        <h1><center>contactNumber: {contactNumber}</center></h1>
        <h1><center>age:{age}</center></h1>
        <h1><center>Batch: {batch}</center></h1> */}
          </div>
          <div style={{ marginTop: 30 }}>

            <Grid container>
              <Grid item xs={12} md={3} lg={2}>
                <List component="nav" aria-label="mailbox folders">
                  <ListItem text>
                    <h1>Filters</h1>
                  </ListItem>
                </List>
              </Grid>
              <Grid item xs={12} md={9} lg={9}>
                <List component="nav" aria-label="mailbox folders">

                  <TextField
                    id="standard-basic"
                    label="Search"
                    fullWidth={true}
                    value={searchInput}
                    // onChange={onChangeSearch}
                    InputProps={{
                      endAdornment: (
                        <InputAdornment>
                          <IconButton  >
                            <SearchIcon />
                          </IconButton>
                        </InputAdornment>
                      ),
                    }}
                  // onChange={customFunction}
                  />

                </List>
              </Grid>
            </Grid>
            <Grid container>
              <Grid item xs={12} md={3} lg={2}>
                <List component="nav" aria-label="mailbox folders">
                  <ListItem>
                    <Grid container spacing={2}>
                      <Grid item xs={12}>
                        Salary
                      </Grid>
                      <Grid item xs={6}>
                        <TextField
                          id="standard-basic"
                          label="Enter Min"
                          fullWidth={true}
                        />
                      </Grid>
                      <Grid item xs={6}>
                        <TextField
                          id="standard-basic"
                          label="Enter Max"
                          fullWidth={true}
                        />
                      </Grid>
                    </Grid>
                  </ListItem>
                  <Divider />
                  <ListItem divider>
                    <Autocomplete
                      id="combo-box-demo"
                      options={users}
                      getOptionLabel={(option) => option.name}
                      fullWidth
                      renderInput={(params) => (
                        <TextField
                          {...params}
                          label="Select Names"
                          variant="outlined"
                        />
                      )}
                    />
                  </ListItem>
                </List>
              </Grid>
              <Grid item xs={12} md={9} lg={9}>
                <Paper>
                  <Table size="small">
                    <TableHead>
                      <TableRow>
                        <TableCell> Sr No.</TableCell>
                        {/* <TableCell>
                          {" "}
                          <Button onClick={sortChange}>
                            {sortName ? <ArrowDownwardIcon /> : <ArrowUpwardIcon />}
                          </Button>
                          Date
                        </TableCell> */}
                        <TableCell>Item</TableCell>
                        <TableCell>price</TableCell>
                        <TableCell>Veg/Non-veg</TableCell>
                        <TableCell>Canteen</TableCell>
                        <TableCell>ManagerName</TableCell>
                        <TableCell>Vendor email</TableCell>
                        <TableCell>Vendor Contact</TableCell>
                        <TableCell>Canteen Open Time</TableCell>
                        <TableCell>Canteen Close Time</TableCell>
                        <TableCell>Canteen Address</TableCell>
                        {/* <TableCell>Quantity</TableCell>
                        <TableCell>Enter_Quantity</TableCell> */}
                        <TableCell>Order_Now</TableCell>
                      </TableRow>
                    </TableHead>
                    <TableBody>
                      {(users).map((user, ind) => (
                        <TableRow key={ind}>
                          <TableCell>{ind}</TableCell>
                          {/* <TableCell>{user.date}</TableCell> */}
                          <TableCell>{user.name}</TableCell>
                          <TableCell>{user.price}</TableCell>
                          <TableCell>{user.FoodDiscription}</TableCell>
                          <TableCell>{user.CanteenName}</TableCell>
                          <TableCell>{user.ManagerName}</TableCell>
                          <TableCell>{user.email}</TableCell>
                          <TableCell>{user.ManagerContact}</TableCell>
                          <TableCell>{user.opening}</TableCell>
                          <TableCell>{user.closing}</TableCell>
                          <TableCell>{user.Address}</TableCell>
                          {/* <TableCell><Grid item xs={12}>
                            <TextField
                              label="Quantity"
                              variant="outlined"
                              value={user.Quantity}
                            // onChange={onChangeQ(user._id)}
                            />
                          </Grid></TableCell> */}
                          {/* <TableCell><Button variant="contained" color="success" onClick={() => { { update(user._id) } }}>
                            Enter_Quantity
                          </Button></TableCell> */}
                          <TableCell><Button variant="contained" color="success">
                            order_now
                          </Button></TableCell>
                        </TableRow>
                      ))}
                    </TableBody>
                  </Table>
                </Paper>
              </Grid>
            </Grid>
          </div>
        </div>
      </Box> 


             </div>

    );
};
export default Myorders_buyer;
